import Expenses from './components/Expenses/Expenses.js';
import NewExpense from './components/NewExpense/NewExpense.js';
// import ExpenseDate from './components/ExpenseDate.js';

const DUMMY_EXPENSES = [
  {title: 'Car Insurance', amount: 294.67, date: new Date()},
  {title: 'Car Insurance 2', amount: 294.67, date: new Date()},
  {title: 'Car Insurance 3', amount: 294.67, date: new Date()},
  {title: 'Car Insurance 4', amount: 294.67, date: new Date()},
]

function App() {
  const [expenses, setExpenses] = useState(DUMMY_EXPENSES); 

  const addExpenseHandler = function(expense) {
    console.log(expense);
  }

  return (
    <div>
      <NewExpense onAddExpense={addExpenseHandler} />
      <Expenses items={expenses}/>
    </div>
  );
}

export default App;
